ソフラン 乾燥機用 25枚入<br>ブランド：ソフラン<br>販売・製造元：ライオン<br><br>着用時だけでなく、乾燥機から衣類を取り出す時の静電気も防止するシート状柔軟剤。<br>柔軟成分が乾燥機中の衣類を滑りやすくし、摩擦や絡まりを抑え、毛玉・ケバ立ち・繊維の傷みを防ぎます。<br>さらに脱水時についたシワもほぐすので、仕上がりはシワが少なく、アイロン掛けも楽に。<br>外で干したようなお日さまの香りです。<br> <br>柔軟剤とは柔軟剤は、洗濯後の衣類の静電気を防止し、ふんわりとした柔軟性を与えるための仕上げ剤です。<br>香りが長く続く柔軟剤、防臭タイプの柔軟剤、乾燥機専用の柔軟剤シートなどが揃っています。<br><br>日用品／洗濯用品／柔軟剤/静電気・シワ対策／乾燥機用柔軟シート<br>JANコード： 4903301302452<br><br>CS：15<br>広告文責：アットライフ株式会社<br>TEL 079-280-2113<br>※商品パッケージは変更の場合あり。<br>メーカー欠品または完売の際、キャンセルをお願いすることがあります。ご了承ください。<br><style type="text/css">
