部屋干し ソフラン 660ml<br>ブランド：ソフラン<br>販売・製造元：ライオン<br><br>生乾きによるイヤなニオイを抑える柔軟仕上げ剤です。<br>抗菌成分CABが、部屋干し時の洗濯物の菌の増殖を抑制し、さらに、ローズマリー抽出消臭成分が中鎖脂肪酸などによる部屋干し臭を抑えます。<br>新開発のやわらか成分が、繊維の1本1本までコート。<br>洗濯物を柔らかく手触りよく仕上げ、静電気の発生を抑え、花粉、ホコリの付着や、衣類のまとわりつきを防ぎます。<br>香りは、フレッシュハーブの香り。<br>自然で爽やかな香りがほのかに漂います。<br>片手で持ちやすいボトルデザインを採用。<br>透明で粘度が低い液なので、洗濯物の柔軟剤投入口を汚しません。<br> <br>用途綿、毛、絹、合成繊維の柔軟仕上げ用 成分柔軟付与剤、界面活性剤(ポリオキシエチレンアルキルエーテル)、抗菌剤、消臭剤、安定剤 <br><br>使用方法<br>全自動洗濯機の場合：柔軟(仕上げ)剤自動投入口に本品を入れて洗濯する。<br>二槽式洗濯機の場合：すすぎの最後に本品を入れ、2-3分まわし、そのまま脱水する。<br> 使用量の目安洗濯機の大きさ(例)高水位の場合使用量の目安(お好みに合わせて使用量を加減してください)洗濯物量水量8.0kg6.0kg65L40ml1杯と1/3杯6.0kg4.5kg60L30ml1杯強4.2kg3.0kg45L20ml3/4杯2.2kg1.5kg30L10ml1/3杯 <br><br>使用上の注意<br>必ず使用前に表示をお読みください。<br>●用途以外に使わない。<br>●乳幼児の手の届くところに置かない。<br>●液を直接衣類にかけない。<br>●原液が洗濯機のフタや床についたときは、水ですぐ拭き取る。<br>放置しておくと傷むことがあるので充分に拭き取る。<br>●洗剤や漂白剤とは一緒に使わない。<br>●ボトルを強く持つと液が出ることがあるので注意する。<br>●他の柔軟剤と混ざらないようにする(液が濁る場合がある)。<br> 応急処置●目に入ったときはすぐに洗い流す。<br>●飲み込んだときは水を飲ませる。<br>●異常があるときは商品を持参し、医師に相談する。<br> 柔軟剤とは柔軟剤は、洗濯後の衣類の静電気を防止し、ふんわりとした柔軟性を与えるための仕上げ剤です。<br>香りが長く続く柔軟剤、防臭タイプの柔軟剤、乾燥機専用の柔軟剤シートなどが揃っています。<br><br>日用品／洗濯用品／柔軟剤/静電気・シワ対策／柔軟剤<br>JANコード： 4903301452409<br><br>CS：8<br>広告文責：アットライフ株式会社<br>TEL 079-280-2113<br>※商品パッケージは変更の場合あり。<br>メーカー欠品または完売の際、キャンセルをお願いすることがあります。ご了承ください。<br><style type="text/css">
