WORKERS 作業着専用洗い 業務用 4500ml<br><br>オレンジオイル(Dリモネン)が頑固な汚れにすばやく浸透し、ニオイのもとまで強力に洗浄する作業着用洗剤です。つけ置き洗いで、さらに効果を発揮します(1時間程度が目安です)。天然植物由来の洗浄成分を使用。色柄ものにも使用できます。また、低泡性なので、ドラム式洗濯機にも使用できます。 <br><br>●洗濯物が多いときや汚れがひどい場合は、洗剤を1割程度多く使用すると、より効果的な洗浄力が得られます。※実際に洗える洗濯物量の目安は、洗たく機の大きさの約7-8割です。※特に落ちにくい汚れは原液を少量、直接塗布してからお洗濯していただくと、より効果的です。  <br><br>ご注意【お洗濯前に必ず確認してください】<br>●衣類の「取扱い絵表示」をお確かめください。<br>●初めて洗う衣類や色落ちが心配な衣類は、原液を衣類の目立たない部分につけて5分ほど置き、変色、色落ちするものは洗わないでください。<br>●本品は蛍光剤を配合しております。きなりやオフホワイト、ベージュ、ピンク等の、淡色系の木綿・麻衣料などは蛍光剤を配合していない洗剤をおすすめします。このような衣類は、蛍光剤の入った洗剤で洗うと白っぽくなることがあります。<br><br>【使用上の注意】<br>●子供の手の届くところに置かない。<br>●用途以外に使用しない。<br>●荒れ性の方や長時間使用する場合、または原液で使用する場合は炊事用手袋を使用する。<br>●使用後は手を水でよく洗い、クリーム等でお手入れをする。<br>●洗たく機のフタなどのプラスチック部分に洗剤がついたまま放置すると傷むことがあるので、水ですぐにふきとる。<br>●高温や低温、および直射日光などを避けて保管する。  <br><br>応急処置<br>●万一飲み込んだ場合は、吐かずに口をすすぎ、水を飲むなどの処置をする。<br>●目に入った場合は、こすらずただちに流水で15分以上洗い流す。<br>●いずれの場合も処置をしたうえ専門医に相談する。※受診時は商品を持参する。  <br><br>品質表示<br>●用途：綿・麻・合成繊維用<br>●液性：弱アルカリ性<br>●成分：界面活性剤(40%ポリオキシアルキレンアルキルアミン、ポリオキシエチレンアルキルエーテル)、安定化剤、アルカリ剤、蛍光増白剤 <br> 原産国：日本<br><br> お問い合わせ先：<br>NSファーファ・ジャパン株式会社 お客様相談室でんわ：03-5669-1230  <br><br>販売_製造元： NSファーファジャパン<br>ブランド：WORKERS<br>JAN：4902135142364<br><br>CS：4<br>広告文責：アットライフ株式会社<br>TEL 079-280-2113<br>※商品パッケージは変更の場合あり。<br>メーカー欠品または完売の際、キャンセルをお願いすることがあります。ご了承ください。<br><style type="text/css">
